metamorphoo, llc. is a collective project between fellow survivors, best friends, and sisters in christ   and  .we seek to be a place of refuge for fellow survivors of domestic violence, sexual assualt, emotional abuse, and childhood abuse. as well as educate a desensitized world on the long lasting effects of trauma. we invite to join is on our continued healing journey as we grow our sisterhood and learn to thrive and not just survive. welcome! 
if you would like to donate to our cause, you can do so here:
www.gofundme.com/metoometamorphoo

